BigStr* _LimitString(mops::BigInt lim, int factor) {
  mops::BigInt i;
  if (mops::Equal(lim, mops::FromC(RLIM_INFINITY))) {
    return str450;
  }
  else {
    i = mops::Div(lim, mops::IntWiden(factor));
    return mops::ToStr(i);
  }
}

